  \"2016-07-27T22:51:23.350372\",\n\t\"name\": \"tamarac-national-wildlife-refuge-narrative-report-september-october-november-december-1950\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tamarac NWR outlines
  Refuge accomplishments from September through December of 1950. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, raptors, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments, plantings, and collections
  and receipts. Resource management is outlined; topics include grazing, haying, fur
  harvesting, and timber removal. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, fishing, and
  violations. N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
